import React from 'react';
import './MyStory.css';

function MyStory() {
  return (
    <div className='mystory'>
        <h1 className='title'>Chi sono?</h1>
        <div className="container">
            <p className='text'></p>
        </div>
    </div>
  )
}

export default MyStory;
